	<div id="qmc">

						</div>

									<div class="qmc-flex-fill">The Qlik Management Console will not work if JavaScript is disabled.</div>
								</main>
							</div>
						</div>
						<div class="popupFooter">
						</div>
					</qmc-popup>
				</qmc-error-popup>
			</noscript>
			<qmc-spinner ng-non-bindable>

			</qmc-spinner>
